If there are files within your Python project besides setup.py or your main_version_file that can provide useful metadata to Cranko — or will need rewriting by Cranko to update versioning and/or dependency information — you must tell Cranko which files it should check. Otherwise, Cranko would have to scan every file in your repository, which would significantly slow it down with large projects. Tell Cranko which additional files to search by adding an annotated_files key to a tool.cranko section in a pyproject.toml file for your project: [tool.cranko]
annotated_files = [ "myproject/npmdep.py", "myproject/rustdep.py",
]
